
const members = ["G.D.", "G.C.", "İ.Y.", "H.A.", "M.K.", "İ.Ö."];
const starting_month = 3;
const starting_year = 2023;
const current_month = new Date().getMonth() + 1;
const current_year = new Date().getFullYear();
const current_time = new Date();
const time_elapsed = (current_year - starting_year) * 12 + (current_month - starting_month);

var options = {
    weekday: 'short',
    day: 'numeric',
    month: 'short',
    year: 'numeric',
    hour: 'numeric',
    minute: 'numeric',
    hour12: false
  };

function getPayerIndex(time_elapsed) {
    const index = time_elapsed % members.length;
    return index >= 0 ? index : index + members.length;
}

function adjustTime(add) {
    const monthNames = [
        "January", "February", "March", "April", "May", "June", "July", "August", "September", "October", "November", "December"
    ];
    let _month = current_month + add;
    let _year = current_year;
    if (_month > 12) {
        _month -= 12;
        _year += 1;
    } else if (_month < 1) {
        _month += 12;
        _year -= 1;
    }
    const _time = ` [${monthNames[_month - 1]}, ${_year}]`;
    return _time;
}

document.getElementById("today").innerHTML = current_time.toLocaleString('en', options);
document.getElementById("previous").innerHTML = `${adjustTime(-1)}: The person who paid last month: ${members[getPayerIndex(time_elapsed - 1)]}`;
document.getElementById("current").innerHTML = `${adjustTime(0)}: The person who will pay this month: ${members[getPayerIndex(time_elapsed)]}`;
document.getElementById("next").innerHTML = `${adjustTime(1)}: The person who will pay next month: ${members[getPayerIndex(time_elapsed + 1)]}`;
document.getElementById("info").innerHTML = `Total paid month: ${time_elapsed + 38}`;















